import React from "react";
import "./../styles/About.css";

const About = () => {
  return (
    <section className="about-section">
      <div className="section-header">
        <h2 className="title">About</h2>

      <p className="description-text">
      As a dedicated data scientist, I specialize in analyzing and interpreting complex datasets to uncover actionable insights that drive strategic decision-making. 
      My expertise lies in developing predictive models, implementing machine learning algorithms, and creating data-driven solutions to solve business challenges. 
      With a strong foundation in programming, statistical analysis, and data visualization, I am committed to transforming raw data into meaningful narratives, fostering data-driven cultures, and delivering innovative strategies to optimize organizational performance.
      </p>
      </div>
    </section>

  );
};

export default About;
